const code = fs.readFileSync('encode.js', 'utf-8') // 源代码
const ast = parse(code);

//ast反混淆插件编写
function decrypt_str(AST) {
    //解密函数相关代码拼接
    let code_join_str = ''
    let func_node = AST.program.body[4]
    let func_code = generate(func_node).code
    code_join_str += func_code
    //$_AI声明函数节点
    let AI_node = AST.program.body[0]
    let AI_code = generate(AI_node).code
    code_join_str += AI_code
     //$_CT声明函数节点
    let CT_node = AST.program.body[2]
    let CT_code = generate(CT_node).code
    code_join_str += CT_code
    // console.log(code_join_str)
    eval(code_join_str) //执行解密环境 运行在内存中
    traverse(AST, {
        VariableDeclaration:function (path) { // 遍历所有变量声明
            if (path.node.declarations.length !== 3) return;
            let declarations_array = path.node.declarations
            if (declarations_array[0].type !== 'VariableDeclarator') return;
            if (declarations_array[1].type !== 'VariableDeclarator') return;
            if (declarations_array[2].type !== 'VariableDeclarator') return;
            //CT函数名判断
            if(!declarations_array[0].init) return;
            if (declarations_array[0].init.type !== 'MemberExpression') return;
            // if (declarations_array[0].init.property.name !== '$_CT') return;
            let scrop_CT_name = generate(declarations_array[0].init).code
            let CT_name = generate(CT_node.expression.left).code
            if (CT_name !== scrop_CT_name) return;

            eval(path + '') // 运行这个变量声明节点
            // console.log(scrop_CT_name)
            // console.log(path+ '')
            // console.log('----------------------------------------')
            //第一个解密函数名
            let first_decrypt_name = declarations_array[0].id.name
            // 第二个解密函数名
            let second_decrypt_name = declarations_array[1].id.name
            let first_decrypt_name_bind = path.scope.getBinding(first_decrypt_name) // 获取第一个解密函数的绑定 Binding对象
            let second_decrypt_name_bind = path.scope.getBinding(second_decrypt_name) // 获取第二个解密函数的绑定
            //不同作用域下有不同的变量解密函数 通过这些条件找到所有符合条件的变量声明所在节点
            first_decrypt_name_bind.referencePaths.map(function(_path){ // 遍历所有引用变量的path
                // 被引用节点的父path是否存在
                if(!_path.parentPath) return;
                //被引用节点的父节点的节点类型是否为调用表达式
                if(_path.parentPath.node.type !== "CallExpression") return;
                //被引用节点的父节点的参数个数是否为1
                if(_path.parentPath.node.arguments.length !== 1)return;
                // 被引用节点的父节点的第一个参数类型是否为数字字面量
                if (_path.parentPath.node.arguments[0].type !== "NumericLiteral") return;
                let decrypt_value =eval(_path.parentPath + '') // 运行这个变量声明节点
                _path.parentPath.replaceInline(types.valueToNode(decrypt_value)) // 替换变量声明节点
                })
                types.valueToNode
            second_decrypt_name_bind.referencePaths.map(function(_path){ // 遍历所有引用变量的path
                // 被引用节点的父path是否存在
                if(!_path.parentPath) return;
                //被引用节点的父节点的节点类型是否为调用表达式
                if(_path.parentPath.node.type !== "CallExpression") return;
                //被引用节点的父节点的参数个数是否为1
                if(_path.parentPath.node.arguments.length !== 1)return;
                // 被引用节点的父节点的第一个参数类型是否为数字字面量
                if (_path.parentPath.node.arguments[0].type !== "NumericLiteral") return;
                let decrypt_value =eval(_path.parentPath + '')
                _path.parentPath.replaceInline(types.valueToNode(decrypt_value))
                })

            // let next_path = path.getNextSibling() // 获取下一个兄弟节点
            // let next_n_path = next_path.getNextSibling() // 获取下下一个兄弟节点
            // console.log(generate(next_path.node).code)
            // console.log(generate(next_n_path.node).code)
             //删除节点
            // path.remove();
            // next_path.remove();
            // next_n_path.remove();
        }
        })
}
